import React from "react";
import "./Footer.css";
import Design from "../Desing/Design";

const Footer = () => {
  return (
    <div
      style={{
        position: "relative",
      }}
    >
      <Design />
      <div
        style={{
          position: "absolute",
        }}
        className="footer"
      >
        <div className="footer-top">
          <div className="footer-top-left">
            <img src="" alt="" />
            <p>
              {" "}
              I am a frontend devloper from, pune with 1+ year of experience
            </p>
          </div>
          <div className="footer-top-right">
            <div className="footer-email-input">
              <img src="./img/person.png" alt="" />
              <input type="email" placeholder="Enter Your Email" />
            </div>
            <div className="footer-scub">Subscribe</div>
          </div>
        </div>
        <hr />
        <div className="footer-botom">
          {/* <p className="footer-bottom-left">@2025 Adib Kazi. All rights reserved.</p> */}
          <div className="footer-bottom-right">
            <p>Term of services</p>
            <p>Privacy Policy</p>
            <p>Connect with me</p>
          </div>
        </div>
      </div>
    </div>
  );
};

export default Footer;
